import React from "react";
import { NavLink } from "react-router-dom";

function NavBar() {
  return (
    <div>
      <h1>Navigation Bar</h1>
      <NavLink to="/" exact>
        Home
      </NavLink>
    </div>
  );
}

export default NavBar;
